
import React, { Component } from 'react';
import {
    AppRegistry,
    StyleSheet,
    Text,
    View,
    TabBarIOS,
    AsyncStorage
} from 'react-native';

import HomePage from './HomePage';
import Read from './Read';
import Weather from './Weather';

var img0_base64 = "data:image/png;base64,";
var img1_base64 = 'data:image/png;base64,';
var img2_base64 = 'data:image/png;base64,';
var img3_base64 = 'data:image/png;base64,';
var img4_base64 = 'data:image/png;base64,';

export default class Main extends Component {
    constructor(props) {
        super(props);
        this.state = {
            selectedTab: 'home',
        };
    }

    render() {
        return (
            <TabBarIOS barTintColor="white" >
                <TabBarIOS.Item
                    title="首页"
                    selected={this.state.selectedTab === 'home'}
                    //icon={require('image!home')}
                    icon={{uri: img0_base64, scale:3.5}}
                    onPress={() => {
                        this.setState({
                            selectedTab: 'home'
                        });
                    }}>
                    {this._renderView('home')}
                </TabBarIOS.Item>
                <TabBarIOS.Item
                    title="阅读"
                    selected={this.state.selectedTab === 'read'}
                    //icon={require('image!read')}
                    icon={{uri: img2_base64, scale:3.5}}
                    onPress={() => {
                        this.setState({
                            selectedTab: 'read'
                        });
                    }}>
                    {this._renderView('read')}
                </TabBarIOS.Item>
                <TabBarIOS.Item
                    title="天气"
                    selected={this.state.selectedTab === 'weather'}
                    //icon={require('image!weather_ic')}
                    icon={{uri: img3_base64, scale:3.5}}
                    onPress={() => {
                        this.setState({
                            selectedTab: 'weather'
                        });
                    }}>
                    {this._renderView('weather')}
                </TabBarIOS.Item>
            </TabBarIOS>
        );
    }

    _renderView(name){
        var view = null;
        switch (name){
            case 'home':
                view = <HomePage></HomePage>;
                break;
            case 'read':
                view = <Read></Read>;
                break;
            case 'weather':
                view = <Weather></Weather>
                break;
            default :
                view = <HomePage></HomePage>;
                break;
        }
        return view;
    }

}
